//! Generation of weight files for benchmarking.


//! //! Autogenerated weights for pallet_mark


// Executed Command:
// ./target/release/cord
// benchmark
// --chain=dev
// --execution=wasm
// --pallet=pallet_mark
// --extrinsic=*
// --steps=20
// --repeat=10
// --output=./pallets/mark/src/weights.rs
// --template=./.maintain/weight-template.hbs


#![allow(unused_parens)]
#![allow(unused_imports)]

use frame_support::{traits::Get, weights::{Weight, constants::RocksDbWeight}};
use sp_std::marker::PhantomData;

/// Weight functions needed for pallet_mark.
pub trait WeightInfo {
	fn anchor() -> Weight;
	fn revoke(d: u32, ) -> Weight;
	fn restore(d: u32, ) -> Weight;
}

/// Weights for pallet_mark using the Substrate node and recommended hardware.
pub struct SubstrateWeight<T>(PhantomData<T>);
impl<T: frame_system::Config> WeightInfo for SubstrateWeight<T> {
	fn anchor() -> Weight {
		(311_226_000_u64)
			.saturating_add(T::DbWeight::get().reads(5_u64))
			.saturating_add(T::DbWeight::get().writes(2_u64))
	}
	fn revoke(d: u32, ) -> Weight {
		(237_102_000_u64)
			// Standard Error: 1_213_000
			.saturating_add((42_281_000_u64).saturating_mul(d as Weight))
			.saturating_add(T::DbWeight::get().reads(2_u64))
			.saturating_add(T::DbWeight::get().reads((1_u64).saturating_mul(d as Weight)))
			.saturating_add(T::DbWeight::get().writes(1_u64))
	}
	fn restore(d: u32, ) -> Weight {
		(184_673_000_u64)
			// Standard Error: 1_448_000
			.saturating_add((50_054_000_u64).saturating_mul(d as Weight))
			.saturating_add(T::DbWeight::get().reads(2_u64))
			.saturating_add(T::DbWeight::get().reads((1_u64).saturating_mul(d as Weight)))
			.saturating_add(T::DbWeight::get().writes(1_u64))
	}
}

